import React from "react";
import PlaybackButton from "./PlaybackButton/PlaybackButton";
import GenereList from "./GenereList/GenereList";
import WaveSurrferPlayer from "./WaveSurrferPlayer/WaveSurferPlayer";
import Time from "./Time/Time";
import { Link } from "react-router-dom";


const Record = ({ item , controls: {seek, playback} , player }) => {

    return (
        <li className="record">
            <header>
                <nav>
                    <Link to={"/my/records/" + item.title} >
                        <h6 className="record-title">{item.title}</h6>
                    </Link>
                </nav>
                <aside>
                    <GenereList list={item.genere} />
                </aside>
            </header>
            <main>
                <PlaybackButton playback={playback} id={item.id} player={player}/>
                <WaveSurrferPlayer seek={seek} item={item} key={item.id} player={player}/>
                <Time item={item} player={player} />
            </main>
        </li>
    )
}

export default Record
